      "function":"__html",
      "metadata":["map"],
      "once_per_event":true,
      "vtp_html":"\u003Cscript type=\"application\/ld+json\"\u003E\n{\n  \"@context\": \"https:\/\/schema.org\",\n  \"@type\": \"FAQPage\",\n  \"mainEntity\": [{\n    \"@type\": \"Question\",\n    \"name\": \"When should I take the SAT?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Most high school students take the SAT, the ACT, or both during the spring of their junior year or fall of their senior year. It's important to leave time to re-take the test if you need to raise your score before you apply to college. The SAT exam is offered nationally every year in August, October, November, December, March, May, and June. View all upcoming SAT test dates.\"\n    }\n  }, {\n    \"@type\": \"Question\",\n    \"name\": \"What is on the SAT?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"There are two  SAT sections: Math and Evidence-Based Reading and Writing.\n      The SAT also includes an optional Essay section. SAT Essay scores are reported separately from overall test scores. Some colleges may require that you complete the SAT Essay. You can confirm each college's admissions policies on the school website or on our  school profiles.\"\n    }\n  }, {\n    \"@type\": \"Question\",\n    \"name\": \"How long is the SAT?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"The SAT is 3 hours long. If you choose to take the SAT with Essay, the test will be 3 hours and 50 minutes.\"\n    }\n  }, {\n    \"@type\": \"Question\",\n    \"name\": \"How is the SAT scored?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Each section of the SAT is scored on a 200 to 800 point scale. Your total SAT score is the sum of your section scores. The highest possible SAT score is 1600. If you take the Essay, you will receive a separate score.\"\n    }\n    }, {\n    \"@type\": \"Question\",\n    \"name\": \"Should I take the SAT or the ACT?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Most colleges and universities will accept scores from either the SAT or ACT, and do not favor one test over the other. That said, college-bound students are increasingly taking  both the SAT and ACT. Changes made to the SAT in 2016 have made it easier than ever to prep for both tests concurrently—and earn competitive scores on both! The best way to decide if taking the SAT, ACT, or both tests is right for you is to take a timed  full-length practice test  of each type. Since the content and style of the SAT and ACT are very similar, factors like how you handle time pressure and what types of questions you find most challenging can help you determine which test is a better fit. Try our  QUIZ: SAT, ACT, or Both?  to learn more.\"\n    }\n    }, {\n    \"@type\": \"Question\",\n    \"name\": \"How do I register for the SAT?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"SAT registration deadlines fall approximately five weeks before each test date. Register online on the College Board website. The  College Board may require SAT registration by mail under special circumstances.\"\n    }\n  }, {\n    \"@type\": \"Question\",\n    \"name\": \"How can I prep for the SAT?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\":\"We can help. We have SAT prep solutions for every student and every budget. \"}\n    }]\n  }\n\n\u003C\/script\u003E",
      "vtp_supportDocumentWrite":false,
      "vtp_enableIframeMode":false,
      "vtp_enableEditJsMacroBehavior":false,
      "tag_id":160
