      "function":"__html",
      "metadata":["map"],
      "once_per_event":true,
      "vtp_html":"\u003Cscript type=\"application\/ld+json\"\u003E\n{\n  \"@context\": \"https:\/\/schema.org\",\n  \"@type\": \"FAQPage\",\n  \"mainEntity\": [{\n    \"@type\": \"Question\",\n    \"name\": \"What is the MCAT?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"The Medical College Admission Test or MCAT is a standardized, multiple-choice exam that most medical schools in the U.S. and some in Canada require as part of your application. It's used to assess whether you understand the concepts and principles that are prerequisite to the study of medicine.\"\n    }\n  }, {\n    \"@type\": \"Question\",\n    \"name\": \"How to Register for the MCAT\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"The MCAT is administered through the Association of American Medical Colleges (AAMC). To register for the examination, you must go to their website and register through the MCAT Registration System. \u003Cbr\u003EAlthough the AAMC provides over 20 test dates per year at hundreds of sites around the world, you shouldn't be tempted to procrastinate about registering. If you do, you may miss out on your desired test date and testing location.\u003Cbr\u003ETo register for the MCAT, follow these steps:\n      \u003Cul\u003E\n        \u003Cli\u003ECreate an account on the AAMC website before registration opens.\u003C\/li\u003E\n        \u003Cli\u003EKeep track of your username, password and security questions.\u003C\/li\u003E\n        \u003Cli\u003EProvide the personal information needed, ensuring that the data you provide matches the government issued ID you intend to use as identification on the day of your test.\u003C\/li\u003E\n        \u003Cli\u003ERemember that after you've filled out all the personal info, you'll be allowed to register for a test date and pick your preferred location.\u003C\/li\u003E\n        \u003Cli\u003EClick on 'Find Seat' to see what's available at your chosen location.\u003C\/li\u003E\n        \u003Cli\u003EIf there are seats available, you can register for that test date. If not, search other locations until you find an open seat.\u003C\/li\u003E\n        \u003Cli\u003EKeep in mind that you'll need your credit card information so that you can pay the registration fee.\u003C\/li\u003E\n      \u003C\/ul\u003E\"\n    }\n  }, {\n    \"@type\": \"Question\",\n    \"name\": \"When to Take the MCAT\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"By your third year of college, you should figure out the best time to take the MCAT. Ideally, you'll choose a date that allows you to have plenty of time to study. You'll also need to determine when the score release date is so that you're able to submit your MCAT score early in the med school application process. Most students take the MCAT at the end of their third year of college or the summer before their fourth year. This strategy gives them enough time to be able to retake the exam in the fall of their fourth year if they're dissatisfied with their score. By the time you take your exam, you should have taken the courses you'll need to know information from, including:\n\n      \u003Cul\u003E\n        \u003Cli\u003EBiology\u003C\/li\u003E\n        \u003Cli\u003EPhysics\u003C\/li\u003E\n        \u003Cli\u003EOrganic and inorganic chemistry\u003C\/li\u003E\n        \u003Cli\u003EBiochemistry\u003C\/li\u003E\n        \u003Cli\u003EPsychology\u003C\/li\u003E\n        \u003Cli\u003ESociology\u003C\/li\u003E\n      \u003C\/ul\u003E\"\n    }\n  }, {\n    \"@type\": \"Question\",\n    \"name\": \"When to Start Preparing for the MCAT\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Many students benefit from three to six months of MCAT preparation. However, you may need more or less time depending on whether you've completed the courses mentioned above and how well you did in each one.\"\n    }\n    }, {\n    \"@type\": \"Question\",\n    \"name\": \"How to Prepare for the MCAT\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"The best way to prepare for the MCAT is to develop a strong study plan. The new MCAT has no prerequisite courses that you have to take. However, the above-mentioned courses should help you prepare for each section of the exam: \n\n      \u003Cul\u003E\n        \u003Cli\u003EBiological and Biochemical Foundations of Living System\u003C\/li\u003E\n        \u003Cli\u003EPsychological, Social and Biological Foundations of Behavior\u003C\/li\u003E\n        \u003Cli\u003EOrganic and inorganic chemistry\u003C\/li\u003E\n        \u003Cli\u003EChemical and Physical Foundations of Biological Systems\u003C\/li\u003E\n      \u003C\/ul\u003E\n      There's no right or wrong way to prepare for the MCAT. However, the prep courses put out by the Princeton Review provide exclusive resources to maximize your results.\"\n    }\n  }, {\n    \"@type\": \"Question\",\n    \"name\": \"What to Do on Test Day\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\":\"It's recommended that you arrive at the testing location 30 minutes before the exam begins. When you show up at the test center, you'll need to check in with the Test Administrator. There are a number of required security measures, including the following steps: \n \u003Cul\u003E\n        \u003Cli\u003ESign in,Present the valid ID that you used when you registered for the exam\u003C\/li\u003E\n        \u003Cli\u003EHave your palms digitally scanned\u003C\/li\u003E\n        \u003Cli\u003EHave a test-day photograph taken\u003C\/li\u003E\n        \u003Cli\u003EStore your belongings in a locker, including your mobile phone and your snack for the break time\u003C\/li\u003E\n      \u003C\/ul\u003E\nWhen your name is called, you'll be shown to the testing area. Before entering, you'll have to show that your pockets are empty. If you wear glasses, they'll be checked to ensure there's no attached camera. You'll then be assigned a computer, which is monitored via security camera.\u003Cbr\u003E\n\nIf you need a break, raise your hand, and the Test Administrator will release you for 10 minutes, during which you can eat a snack or use the restroom. Upon your return, you'll need to empty your pockets once more. When you're finished, raise your hand, and you'll be released.\"}\n    }]\n  }\n\n\u003C\/script\u003E",
