      "vtp_html":"\u003Cscript type=\"application\/ld+json\"\u003E\n{\n  \"@context\": \"https:\/\/schema.org\",\n  \"@type\": \"FAQPage\",\n  \"mainEntity\": [{\n    \"@type\": \"Question\",\n    \"name\": \"What should go on a college resume?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Any of the sections below could appear on your resume for college applications. Pick an assortment that works for you! \u003Cul\u003E\n        \u003Cli\u003EHeading with your name, address, and e-mail\u003C\/li\u003E\n        \u003Cli\u003EHigh school information with your graduation date, GPA (weighted), class rank, and SAT\/ACT scores\u003C\/li\u003E\n        \u003Cli\u003EAcademic awards, publications, honors, and other achievements\u003C\/li\u003E\n        \u003Cli\u003ECoursework (summer programs, college courses, or other specialized workshops that do not appear on your high school transcript)\u003C\/li\u003E\n        \u003Cli\u003EExtracurricular activities\u003C\/li\u003E\n        \u003Cli\u003ECommunity service\u003C\/li\u003E\n        \u003Cli\u003EWork experience\u003C\/li\u003E\n        \u003Cli\u003EHobbies\u003C\/li\u003E\n        \u003Cli\u003ESpecial skills (e.g. foreign language fluency or HTML expertise)\u003C\/li\u003E\n      \u003C\/ul\u003E\"\n    }\n  }, {\n    \"@type\": \"Question\",\n    \"name\": \"When should you submit a resume to colleges?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Some colleges and scholarship committees request or recommend that you include a high school resume with your application materials. (But don’t submit a resume if they don’t ask for one—following instructions is a key application strategy.) Bring your resume to college interviews and give copies to your college counselor and teachers so that they can write you the strongest possible recommendation letter.\"\n    }\n    }]\n  }\n\n\u003C\/script\u003E",
