      "once_per_event":true,
      "vtp_html":"\u003Cscript type=\"application\/ld+json\"\u003E\n{\n  \"@context\": \"https:\/\/schema.org\",\n  \"@type\": \"FAQPage\",\n  \"mainEntity\": [{\n    \"@type\": \"Question\",\n    \"name\": \"How to Register for the ACT\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"You can register online for the ACT, a process which takes about 40 minutes. First, find a test date that works for you, and make sure that you register early, before the deadline. To do so, you'll need the following:\n      \u003Cul\u003E\n        \u003Cli\u003EComputer with internet access\u003C\/li\u003E\n        \u003Cli\u003EACT student web account\u003C\/li\u003E\n        \u003Cli\u003EYour high school course details\u003C\/li\u003E\n        \u003Cli\u003ERecent photo of yourself that meets the ACT guidelines\u003C\/li\u003E\n        \u003Cli\u003ECredit card or other form of payment to pay the registration fee unless you qualify for a fee waiver\u003C\/li\u003E\u003E\n      \u003C\/ul\u003E\"\n    }\n  }, {\n    \"@type\": \"Question\",\n    \"name\": \"When to Take the ACT\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"The ACT can be taken as early as grade six. However, most students take the test for the first time during the spring of their junior year. Scores are provided anywhere from two to eight weeks after the test. Those unsatisfied with their scores will then have enough time to retake the ACT during the fall of their senior year.\"\n    }\n  }, {\n    \"@type\": \"Question\",\n    \"name\": \"When to Start Preparing for the ACT\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Depending on when you're planning to take the ACT, it's never too soon to begin the prep process. However, the majority of students take their preparations more seriously in the spring and summer before their junior year. If you do the same, you'll be ready to take the test in the spring of your junior year. This plan also gives you enough time if you want to retake the ACT in the fall of your senior year.\"\n    }\n  }, {\n    \"@type\": \"Question\",\n    \"name\": \"How to Prepare for the ACT\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"The ACT is directly related to the high school courses you're currently taking — English, math, reading and science. As you attend classes and work hard to excel, you're actually preparing to do well on the ACT. However, to get a top score, you'll want to turn to the trusted results provided by The Princeton Review. You can take our free practice test online . After that, we'll give you your personalized report that lets you know which areas you're strong in and which areas need improvement.\u003Cbr\u003E The best way to prepare for the test is to sign up for our ACT Prep course . Our team has over 35 years of experience teaching the ACT and can ensure you get the maximum results in a minimum amount of time.\"\n    }\n  }, {\n    \"@type\": \"Question\",\n    \"name\": \"What to Do on Test Day\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\":\"The best thing you can do for yourself on your ACT test day is to be calm and prepared. During the test and the breaks, you cannot use a prohibited electronic device or cell phone. If you do, you'll be dismissed, and your test will not be scored. However, there are a few things you should be sure to bring with you, including:\n \u003Cul\u003E\n        \u003Cli\u003EYour ticket to the test center\u003C\/li\u003E\n        \u003Cli\u003EAcceptable form of identification\u003C\/li\u003E\n        \u003Cli\u003ETwo number 2 pencils\u003C\/li\u003E\n        \u003Cli\u003EWatch without an alarm\u003C\/li\u003E\n        \u003Cli\u003EPermitted calculator\u003C\/li\u003E\n        \u003Cli\u003ESnacks for break time\u003C\/li\u003E\n      \u003C\/ul\u003E\nCome early the day of your test. The center opens at 7:45 a.m., and doors close promptly at 8 a.m. If you're late, you will not be admitted. Once you break the seal on your booklet, the test has begun. There are four separate tests covering English, math, reading and science, as well as a fifth test that helps develop future ACTs but is not reflected in your score. \u003Cbr\u003E After the first two tests, you'll be allowed to leave the room for a short break. During this time, cell phones and other electronic devices are still prohibited. Once the test administrator collects all the test booklets, students are dismissed.\u003Cbr\u003E If you took the ACT® with writing, multiple-choice scores are posted first, and your writing scores will be posted online as soon as they are ready.\"}\n    }]\n  }\n\n\u003C\/script\u003E",
