      "vtp_html":"\u003Cscript type=\"application\/ld+json\"\u003E\n{\n  \"@context\": \"https:\/\/schema.org\",\n  \"@type\": \"FAQPage\",\n  \"mainEntity\": [{\n    \"@type\": \"Question\",\n    \"name\": \"What's Important about ACT Test Dates\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"If you haven't already, check out the upcoming ACT test and registration dates. Here are some tips and ACT facts to help you make your decision.\n    \u003Cul\u003E\n        \u003Cli\u003EIn 2018, there are 7 ACT dates: September, October, December, February, April, June, and July.\u003C\/li\u003E\n        \u003Cli\u003EFebruary and June dates are not available in New York state.\u003C\/li\u003E\n        \u003Cli\u003EMany states also offer an additional ACT as part of their state testing. Check with your high school to see if and when your state offers a school-day ACT.\u003C\/li\u003E\n        \u003Cli\u003EYour school will register you automatically for a state ACT (if offered). You must register yourself for all other administrations.\u003C\/li\u003E\n        \u003Cli\u003EMany high schools still recommend taking the ACT the spring of your junior year because the content of the Math test includes topics some curricula do not cover before then. However, these topics appear in only a handful of questions, and many juniors take their first ACT in the fall or winter.\u003C\/li\u003E\n        \u003Cli\u003ELearn exactly how to register for the ACT.\u003C\/li\u003E\n    \u003C\/ul\u003E\"\n    }\n  }, {\n    \"@type\": \"Question\",\n    \"name\": \"What's Important about SAT Test Dates\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Check out the upcoming SAT test and registration dates and then read these SAT facts:\n      \u003Cul\u003E\n        \u003Cli\u003EIn the United States, the SAT is given 7 times a year: March, May, June, August, October, November, and December.\u003C\/li\u003E\n        \u003Cli\u003EAlthough you may take the SAT any time starting freshman year, most students take it for the first time in the spring of their junior year and possibly retake it in the fall of their senior year.\u003C\/li\u003E\n        \u003Cli\u003EYou may also need to take SAT Subject Tests (many competitive colleges require them), so don’t leave everything to the last minute. You can’t take the SAT and SAT Subject Tests on the same day.\u003C\/li\u003E\n        \u003Cli\u003ENot all SAT Subject Tests are offered on each test date, so plan accordingly.\u003C\/li\u003E\n        \u003Cli\u003ELearn exactly how to register for the SAT.\u003C\/li\u003E\n      \u003C\/ul\u003E\"\n    }\n  }, {\n    \"@type\": \"Question\",\n    \"name\": \"How Many Times Should You Take the ACT and\/or SAT?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"For security reasons, ACT will not let you take the exam more than twelve times, and technically the SAT is unlimited. But we don't believe colleges will accept “taking standardized tests” as an extracurricular activity!\u003Cbr\u003E We recommend that you plan to take the ACT and\/or SAT 1–3 times. Once you get the score you want, there’s no reason to take it again.\"\n    }\n    }]\n  }\n\n\u003C\/script\u003E",
