      "once_per_event":true,
      "vtp_html":"\u003Cscript type=\"application\/ld+json\"\u003E\n{\n  \"@context\": \"https:\/\/schema.org\",\n  \"@type\": \"FAQPage\",\n  \"mainEntity\": [{\n    \"@type\": \"Question\",\n    \"name\": \"How important is your pre-med major?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"What you major in doesn’t matter nearly as much to admission committees as your GPA.  And many future doctors do major in non-science related fields. Keep in mind that med schools do pay special attention to your science GPA  (biology, chemistry, physics, and math)—what med schools call BCPM—so it’s important to keep your grades up across the board, and make sure you’re choosing classes that fulfill both your major requirements and your medical school application requirements. The best pre-med major for you is something that truly interests you (and that you can excel in), rather than merely what you think med schools want to see.\"\n    }\n    }]\n  }\n\n\u003C\/script\u003E",
