      "once_per_event":true,
      "vtp_html":"\u003Cscript type=\"application\/ld+json\"\u003E\n{\n  \"@context\": \"https:\/\/schema.org\",\n  \"@type\": \"FAQPage\",\n  \"mainEntity\": [{\n    \"@type\": \"Question\",\n    \"name\": \"What is Test Anxiety?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"While it’s completely normal to feel a bit nervous before a test, some students find test anxiety debilitating. Racing thoughts, inability to concentrate, or feelings of dread can combine with physical symptoms like a fast heartbeat, headache, or nausea. Whether it’s the ACT , an AP exam , or an important history final, test anxiety has the power to derail weeks and months of hard work.\"\n    }\n    }]\n  }\n\n\u003C\/script\u003E",
