      "once_per_event":true,
      "vtp_html":"\u003Cscript type=\"application\/ld+json\"\u003E\n{\n  \"@context\": \"https:\/\/schema.org\",\n  \"@type\": \"FAQPage\",\n  \"mainEntity\": [{\n    \"@type\": \"Question\",\n    \"name\": \"How Important is GPA for Med School?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Generally speaking, your undergraduate performance is the most important aspect of your medical school application . The most competitive medical schools may use national GPA averages as cutoffs for initial selection. But at most medical schools, successful candidates can still score below these national averages, if they are above average in any of the other components of their applications.\u003Cbr\u003E Top schools also consider subjective aspects of a student’s academic record, such as the type and difficulty of courses taken, GPA trends (an upward trajectory is good!), special academic projects undertaken, and the reputation of your college or pre-med major .\"\n    }\n  }, {\n    \"@type\": \"Question\",\n    \"name\": \"Which GPAs do Med Schools Care About?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Your GPA, for the purposes of applying to medical school , consists of your science GPA, your non-science GPA, and your cumulative GPA. Your science GPA is comprised of grades in medical school prerequisite classes like biology, chemistry, physics, and math. Your non-science GPA is comprised of grades in all your other classes. Each GPA is calculated for your undergraduate career, for any non degree-seeking postsecondary work, and for any degree seeking postsecondary programs. In other words, you could conceivably have nine different GPAs! Each medical school has its own policies for deciding which GPA means the most to them when they’re choosing which applicants to interview and\/or to accept.\"\n    }\n  }, {\n    \"@type\": \"Question\",\n    \"name\": \"What is a Good GPA for Med School?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"It is extremely difficult to get into medical school with a cumulative GPA of less than 3.0.\"\n    }\n    }]\n  }\n\n\u003C\/script\u003E",
