      "vtp_html":"\u003Cscript type=\"application\/ld+json\"\u003E\n{\n  \"@context\": \"https:\/\/schema.org\",\n  \"@type\": \"FAQPage\",\n  \"mainEntity\": [{\n    \"@type\": \"Question\",\n    \"name\": \"Do med schools prefer traditional students over non-traditional students?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"If you are an older applicant wondering just how the application process treats nontraditional students, keep in mind that medical schools today admit a wide variety of applicants with special talents and backgrounds. Their aim is to bring true diversity to the average modern entering class of medical school students, making the word “nontraditional” less relevant. Students often take a year or two off from academics for other pursuits, stay an extra year at their undergraduate university to obtain more education, or work a while before applying. Some even take extended time off to raise a family, or switch careers after trying other professions.\"\n    }\n    }]\n  }\n\n\u003C\/script\u003E",
