      "metadata":["map"],
      "once_per_event":true,
      "vtp_html":"\u003Cscript type=\"application\/ld+json\"\u003E\n{\n  \"@context\": \"https:\/\/schema.org\",\n  \"@type\": \"FAQPage\",\n  \"mainEntity\": [{\n    \"@type\": \"Question\",\n    \"name\": \"What is the GRE?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"The GRE General Test is a graduate-level admissions exam used by many graduate school and business school programs. The GRE provides grad and b-schools with one common criterion that can be used to compare all applicants, who  come from all over the world and will certainly have an enormous range in academic and professional experience.\u003Cbr\u003EYour  GRE score is a significant part of your graduate school application , but it certainly isn’t the only part. Admissions officers consider many other factors, including your undergraduate GPA, work and research experience,  personal statement , letters of recommendation, and interviews. Some grad programs also require or consider GRE Subject Test scores.\u003Cbr\u003EIt’s possible your GRE score could come in handy if you are interested in law school, as some schools are accepting (or are considering accepting) GRE scores in lieu of LSAT scores .\"\n    }\n  }, {\n    \"@type\": \"Question\",\n    \"name\": \"What's on the GRE?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"There are three GRE sections: Verbal, Quantitative (math), and Analytical Writing. The GRE tests college-level vocabulary and verbal reasoning; basic math concepts in arithmetic, algebra, and geometry; and your writing and analytical skills.\"\n    }\n    }, {\n    \"@type\": \"Question\",\n    \"name\": \"How Long does the GRE Take?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Start to finish, the exam will take you 3 hours and 45 minutes to complete.\"\n    }\n    }, {\n    \"@type\": \"Question\",\n    \"name\": \"How do I register?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"You must register online to take the GRE in advance of your test date; walk-in GRE registration at test centers is not accepted. The GRE is administered by ETS and given at Prometric testing centers. Visit ETS  to register. The GRE costs $205 in most locations.\"\n    }\n    }, {\n    \"@type\": \"Question\",\n    \"name\": \"How is the GRE scored?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"GRE test-takers will receive three separate scores, one for each section. Math and Verbal GRE scores fall on a scale of 130–170. Analytical Writing scores range from 0–6. Some test takers will also see an additional experimental math or verbal section, which will not be included in the final score. Learn more about GRE scoring .\"\n    }\n    }, {\n    \"@type\": \"Question\",\n    \"name\": \"Do GRE test scores expire?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Your GRE score remains valid for five years.\"\n    }\n    }, {\n    \"@type\": \"Question\",\n    \"name\": \"How important is your GRE score?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Schools differ in how they use your GRE score. Some programs weight GRE scores very heavily or have a minimum score for applicants, while other programs consider scores more of a formality. We recommend asking your prospective grad and business programs about the unique role the GRE test plays in their admissions and financial aid decisions.  You can also check out the admissions data in our grad school and business school profiles .\"\n    }\n    }, {\n    \"@type\": \"Question\",\n    \"name\": \"How does the computer-adaptive GRE work?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"The GRE is a computer-adaptive test, or CAT for short. Every test taker will see a least two Math sections and two Verbal sections. The difficulty level of the second section (easy, medium or hard) in each subject is determined by your performance on the first section. If you get lots of questions right on the first section, you will get a harder second section, but access to higher scores. If you don’t get as many questions right on the first section, you will get an easier second section and your scoring potential is capped at a lower range.\u003Cbr\u003E The computer-delivered GRE is the standard format for test takers. The paper-based GRE is far more rare and only offered up to three times a year. But if you want to learn more about the paper-and-pencil test, visit  ETS.org .\"\n    }\n    }, {\n    \"@type\": \"Question\",\n    \"name\": \"What are GRE Subject Tests?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"The GRE Subject Tests are similar to the SAT Subject Tests in that they test your knowledge of a particular subject like chemistry or literature. Not every school requires a GRE Subject Test, but many of the most competitive programs do. ETS offers the Subject Tests three times a year; they are not part of the standard GRE.  There are six GRE Subjects: biology, chemistry, English literature, math, physics, and psychology.\"\n    }\n  }, {\n    \"@type\": \"Question\",\n    \"name\": \"How can I prepare for the GRE?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"We can help you unlock a higher GRE score. We have efficient  GRE prep options for every student and every budget.\"\n    }\n    }]\n  }\n\n\u003C\/script\u003E",
