      "vtp_html":"\u003Cscript type=\"application\/ld+json\"\u003E\n{\n  \"@context\": \"https:\/\/schema.org\",\n  \"@type\": \"FAQPage\",\n  \"mainEntity\": [{\n    \"@type\": \"Question\",\n    \"name\": \"When can you take the LSAT?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"The LSAT is currently given four times a year—in February, June, October (occasionally late September), and December. Starting in mid-2018, there will be seven test dates annually.\"\n    }\n  }, {\n    \"@type\": \"Question\",\n    \"name\": \"How to Choose Your LSAT Date\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Schedule your LSAT test early enough that your scores will be available by your first law school application deadline. You can find the deadlines for many law schools under the “Admissions” tab of our law school profiles . We recommend that you submit your applications between late September and early November.\u003Cbr\u003ETypically, students applying for regular fall admission take the test during June or September\/October of the previous calendar year. You can take the test in December or February, but many schools will have filled some of their seats by the time your scores hit the admissions office.\"\n    }\n    }]\n  }\n\n\u003C\/script\u003E",
