      "once_per_event":true,
      "vtp_html":"\u003Cscript type=\"application\/ld+json\"\u003E\n{\n  \"@context\": \"https:\/\/schema.org\",\n  \"@type\": \"FAQPage\",\n  \"mainEntity\": [{\n    \"@type\": \"Question\",\n    \"name\": \"What is a Good GPA?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"The answer to this depends on where you want to go to college. Check out the GPA ranges for accepted students to the schools on your wishlist, and see how your grades compare. Use our college search to research schools that interest you or grab a copy of our book Best 384 Colleges to help you find your best-fit school.\u003Cbr\u003EColleges will also consider the rigor of your high school schedule. Did you take Honors and AP courses when they were available? Were you enrolled in your high school’s IB program? Besides doing well in the courses you took, colleges want to see that you are challenging yourself academically.\"\n    }\n    }]\n  }\n\n\u003C\/script\u003E",
