      "vtp_html":"\u003Cscript type=\"application\/ld+json\"\u003E\n{\n  \"@context\": \"https:\/\/schema.org\",\n  \"@type\": \"FAQPage\",\n  \"mainEntity\": [{\n    \"@type\": \"Question\",\n    \"name\": \"What is a major?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Your major in college is your specialized area of study. Beyond general college requirements, you'll also take a group of courses in a subject of your choosing such as Chemistry, Comparative Literature, or Political Science. At some schools you can even design your own major.\"\n    }\n    }, {\n    \"@type\": \"Question\",\n    \"name\": \"How important is your major?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"The major you choose will neither predict nor guarantee your future. Many graduates find jobs that have nothing to do with what they studied in college. According to the U.S. Department of Labor, the average twenty-something switches jobs once every three years and the average person changes career fields two or three times in their lifetime.\u003Cbr\u003EIf you intend to earn a professional degree (like an MD) after college, you will probably need certain courses, or prerequisites, under your belt. But many future doctors major in non-science related fields. \"\n    }\n    }, {\n    \"@type\": \"Question\",\n    \"name\": \"When do I declare a major?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Typically in your sophomore or junior year, but the answer varies across schools and programs. Some colleges ask you to list your expected major on your college application (although 'undecided' is usually an option), but don't require you to declare definitively until later.\u003Cbr\u003E If you are interested in a major that requires a lot of classes, or classes that are limited to students in that major, then it is better to declare early. Some majors demand a strictly regimented order of courses, and if you fall behind, you may have to extend your college stay by a semester or two.\"\n    }\n    }, {\n    \"@type\": \"Question\",\n    \"name\": \"Can I change my mind?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Definitely. One of the most exciting aspects of college life is that it introduces you to new subjects and fosters new passions. You might enter undergrad enjoying physics but discover a burgeoning love for political science. However, keep this mind: Every major has requisite coursework. Some require you to take introductory courses before you move into the more advanced classes. Also, some classes are offered in the fall but not in the spring, or vice-versa. If you change your major late in the game, it may take more than the traditional four years to earn a degree.\"\n    }\n    }]\n  }\n\n\u003C\/script\u003E",
      "vtp_supportDocumentWrite":false,
