      "once_per_event":true,
      "vtp_html":"\u003Cscript type=\"application\/ld+json\"\u003E\n{\n  \"@context\": \"https:\/\/schema.org\",\n  \"@type\": \"FAQPage\",\n  \"mainEntity\": [{\n    \"@type\": \"Question\",\n    \"name\": \"How Are SAT Subject Tests Used by Colleges?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Many colleges require or recommend one or more SAT Subject Tests. Because the tests are designed to measure knowledge in specific areas, colleges use them as another piece of admissions information, and, in some cases, to decide whether applicants can be exempted from college requirements. For example, a certain score may excuse you from a basic English class or a foreign language requirement. If you're not sure which Subject Tests to take, talk to your college counselor.\"\n    }\n    }, {\n    \"@type\": \"Question\",\n    \"name\": \"What’s a Good Subject Test Score?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"It depends on the college of your choice. A good SAT Subject Test Score is one that fits within the range of scores your college usually looks for or accepts. Many colleges are happy with scores of 650 or above, but highly selective schools may want to see a 700 or 750—or even higher. However, if your score falls below the normal score range for your dream school, that doesn’t necessarily mean you won’t get in. Schools are often fairly flexible in what they are willing to look at as a “good” score for a certain student.\"\n    }\n    }]\n  }\n\n\u003C\/script\u003E",
