      "vtp_html":"\u003Cscript type=\"application\/ld+json\"\u003E\n{\n  \"@context\": \"https:\/\/schema.org\",\n  \"@type\": \"FAQPage\",\n  \"mainEntity\": [{\n    \"@type\": \"Question\",\n    \"name\": \"How Long Does It Take to Send SAT Scores?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"The fastest way to send SAT scores is to request score report recipients when you register for the SAT. Depending on when you take the SAT test, you may get your scores back anywhere from two to six weeks after your test date. SAT score reports are then sent to colleges within 10 days after your scores are released to you. Once colleges receive your scores, they still need time to process them, which can take up to a week. \"\n    }\n    }]\n  }\n\n\u003C\/script\u003E",
