      "vtp_html":"\u003Cscript type=\"application\/ld+json\"\u003E\n{\n  \"@context\": \"https:\/\/schema.org\",\n  \"@type\": \"FAQPage\",\n  \"mainEntity\": [{\n    \"@type\": \"Question\",\n    \"name\": \"What is the PSAT and why is it important?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"The PSAT won’t count towards your college admissions applications, but it is the qualifying test for the National Merit Scholarship. Some of the highest scoring students may win scholarship money, so while you shouldn’t stress out about the PSAT, you certainly shouldn’t ignore it either. Use the PSAT as practice for the SAT and ACT and an important guidepost on your college admissions journey.\"\n    }\n    }, {\n    \"@type\": \"Question\",\n    \"name\": \"When is the PSAT?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"The PSAT is offered nationally every year in October. Ask your school counselor about when your class is scheduled to take the PSAT. View upcoming PSAT test dates.\"\n    }\n    }, {\n    \"@type\": \"Question\",\n    \"name\": \"What does the PSAT test?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"The PSAT has two sections: Math and Evidence-Based Reading and Writing.  You’ll encounter passage-based questions—sometimes accompanied by tables, graphs, and charts—and math problems drawing upon algebra, geometry, and a little trig.\"\n    }\n    }, {\n    \"@type\": \"Question\",\n    \"name\": \"How is the PSAT scored?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Each section is scored on a scale of 160–760, making a “perfect” score 1520. There are also test scores, cross-test scores, and subscores. Find out more about PSAT scoring.\"\n    }\n    }, {\n    \"@type\": \"Question\",\n    \"name\": \"Did I get a good PSAT score?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Good question. The highest scores and percentiles earn National Merit Recognition. But PSAT scores are also useful in determining your best prep strategies for the SAT or ACT. For a PSAT score report consultation, call us at 800-2REVIEW.\"\n    }\n    }, {\n    \"@type\": \"Question\",\n    \"name\": \"How do I register for the PSAT?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Check with a counselor at your school or at a school in your community to sign up.\"\n    }\n    }, {\n    \"@type\": \"Question\",\n    \"name\": \"How should I prepare for the PSAT?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"The PSAT and SAT tests are almost identical: the PSAT is 15 minutes shorter, does not include an essay, and has a slightly different scoring scale. By prepping for the SAT, you are prepping for both tests! For a limited time, get our PSAT prep (a $299 value) for free when you enroll in a comprehensive SAT course or tutoring program.\"\n    }\n    }]\n  }\n\n\u003C\/script\u003E",
