      "once_per_event":true,
      "vtp_html":"\u003Cscript type=\"application\/ld+json\"\u003E\n{\n  \"@context\": \"https:\/\/schema.org\",\n  \"@type\": \"FAQPage\",\n  \"mainEntity\": [{\n    \"@type\": \"Question\",\n    \"name\": \"When should I take the ACT?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Most high school students take the ACT, SAT, or both during the spring of their junior year or fall of their senior year. It's important to leave time to re-take the test if you need to raise your score before you apply to college. The ACT exam is offered nationally every year in September, October, December, February*, April, June, and July*.\"\n    }\n    }, {\n    \"@type\": \"Question\",\n    \"name\": \"What is on the ACT?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"There are four ACT sections:   \n\u003Cul\u003E\n\u003Cli\u003EEnglish\u003C\/li\u003E\n\u003Cli\u003EReading\u003C\/li\u003E\n\u003Cli\u003EMath\u003C\/li\u003E\n\u003Cli\u003EScience\u003C\/li\u003E\n\u003C\/ul\u003E\u003Cbr\u003E\nThe ACT also includes an optional 40-minute Writing Test. Some colleges may require that you complete the ACT Writing Test. You can confirm each college's admissions policies on the school website or on our school profiles.\"\n    }\n    }, {\n    \"@type\": \"Question\",\n    \"name\": \"How long is the ACT?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"The ACT is 2 hours and 55 minutes long. If you choose to take the ACT with Essay, the test will be 3 hours and 35 minutes long.\"\n    }\n    }, {\n    \"@type\": \"Question\",\n    \"name\": \"How is the ACT scored?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Each section of the ACT is scored on a 1 to 36 point scale. Your composite ACT score is the average of your four section scores, also on a scale from 1 to 36. If you take the ACT with Writing Test, you will receive a separate score on the Writing Test.\"\n    }\n    }, {\n    \"@type\": \"Question\",\n    \"name\": \"Should I take the ACT or the SAT?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Most colleges and universities will accept scores from either the SAT or ACT, and do not favor one test over the other. That said, college-bound students are increasingly taking both the SAT and ACT. Changes made to the SAT in 2016 have made it easier than ever to prep for both tests concurrently—and earn competitive scores on both! The best way to decide if taking the SAT, ACT, or both tests is right for you is to take a timed full-length practice test of each type. Since the content and style of the SAT and ACT are very similar, factors like how you handle time pressure and what types of questions you find most challenging can help you determine which test is a better fit. Try our QUIZ: SAT, ACT, or Both? to learn more\"\n    }\n    }, {\n    \"@type\": \"Question\",\n    \"name\": \"How do I register for the ACT?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Registration deadlines fall approximately five weeks before each ACT test date. You can get registration materials from your school counselor, or you can register online on the ACT website.\"\n    }\n    }, {\n    \"@type\": \"Question\",\n    \"name\": \"How can I prep for the ACT?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"We can help. We have ACT prep solutions for every student and every budget. \"\n    }\n    }]\n  }\n\n\u003C\/script\u003E",
